import React, { useState, useEffect } from "react";
import "./style.css";
import { Link } from "react-router-dom";

const Home = () => {
  const [houses, setHouses] = useState([]);
  const [searchQuery, setSearchQuery] = useState(""); // State for search input

  // Fetch houses from backend API
  useEffect(() => {
    fetch("/api/houses")
      .then((response) => response.json())
      .then((data) => {
        if (Array.isArray(data)) {
          setHouses(data);
        } else {
          console.error("Unexpected data format:", data);
        }
      })
      .catch((error) => console.error("Fetch error:", error));
  }, []);

  // Function to handle NLP-based search
  const handleSearch = () => {
    fetch("http://localhost:5000/search", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ query: searchQuery }), // Send user input as query
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json(); // Parse JSON response
      })
      .then((data) => {
        setHouses(data); // Set filtered houses with returned search data
      })
      .catch((error) => console.error("Search error:", error));
  };

  // Function to render houses for a specific category
  const renderCategory = (categoryName) => {
    const categoryHouses = houses.filter(
      (house) => house.name === categoryName
    );
    const [showMore, setShowMore] = useState(false); // For showing more houses

    return (
      <div className="category-section">
        <h3>{categoryName}</h3>
        <div className="row gx-0 gap-5 mt-3 mx-auto justify-content-center">
          {categoryHouses.slice(0, showMore ? categoryHouses.length : 3).map((house, index) => (
            <div key={index} className="col-sm-4 col-md-5 col-lg-3 col-xl-3 card">
              <Link
                to={`/houseDetails/${house._id}`}
                className="text-reset text-decoration-none"
                target="_blank"
              >
                <img
                  src={house.images?.exterior?.[0] || "default-image.jpg"} // Ensure there's an exterior image
                  className="card-img-top"
                  alt={house.name}
                />
                <div className="card-body">
                  <div className="card-content">
                    <h5>{house.name}</h5>
                    <p>{house.desp}</p>
                  </div>
                  <div className="card-btn text-end">
                    <button className="btn btn-outline-dark">Visit</button>
                  </div>
                </div>
              </Link>
            </div>
          ))}
        </div>
        <div className="text-end mt-3">
          {!showMore && categoryHouses.length > 3 && (
            <button
              className="btn btn-secondary"
              onClick={() => setShowMore(true)}
            >
              View More
            </button>
          )}
          {showMore && (
            <button
              className="btn btn-secondary"
              onClick={() => setShowMore(false)}
            >
              View Less
            </button>
          )}
          <Link to={`/category/${categoryName}`}>
            <button className="btn btn-primary">View All</button>
          </Link>
        </div>
      </div>
    );
  };

  return (
    <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 main p-5">
      <div className="text-center title-text">
        A complete solution for Planning & Designing your dream Home
      </div>
      <div className="container input-group search-input mt-4 mb-5">
        <input
          type="text"
          className="form-control border border-dark"
          placeholder="Enter your requirements..."
          aria-label="Enter your requirements..."
          value={searchQuery} // Controlled input for search
          onChange={(e) => setSearchQuery(e.target.value)} // Update search query
        />
        <button
          className="btn bg-light input-group-append"
          type="button"
          onClick={handleSearch} // Trigger NLP search
        >
          <i className="fa fa-search"></i>
        </button>
      </div>
      <div className="container">
        {/* Render category sections */}
        {renderCategory("Bungalow")}
        {renderCategory("Villa")}
        {renderCategory("Building")}
        {/* Add more categories as needed */}
      </div>
    </main>
  );
};

export default Home;
